import React from 'react'
import {Counter, Todo} from 'components/index'
import {Route} from 'react-router-dom'

const App = () => {
return (
    <>
      <Route exact path='/counter' component={Counter}/>
      <Route exact path='/todo' component={Todo}/>
    </>
  )
}

export default App
